    getPath: function (name) {
        try {
            if (typeof this[name] !== "undefined") {
                let domparser = new DOMParser();
                let xmldoc = domparser.parseFromString(this[name], "text/xml");
                if (xmldoc.documentElement.nodeName === "svg") {
                    let childNodes = xmldoc.documentElement.childNodes;
                    let path = [];
                    for (let i = 0; i < childNodes.length; i++) {
                        let attributes = childNodes[i].attributes;
                        for (let t = 0; t < attributes.length; t++) {
                            if (attributes[t].name == "d")
                                path.push(attributes[t].nodeValue);
                        }
                    }
                    return "path://" + path.join(" ");
                } else {
                    console.log("Xml is not svg string.\n" + this[name]);
                    return null;
                }
            } else {
                console.log("System svg '" + name + "' is not exists.");
                return null;
            }

        } catch (e) {
            console.log(e);
            return null;
        }
    },
